const Feed = ( props) => 
{
  return (
    <div className="container" style={{width:'25%', margin:'0', height:'300px', border:'1px solid black', padding:'0'}}>
        <div className="container-fluid" style={{ backgroundColor:'lightgrey', height:'90%' }}> 

        </div>
        <div className="container-fluid text-center">
            <b>Feed#</b> { props.ID } <b>Location:</b> {props.location}
        </div>
    </div>
  )
}

export default Feed
